import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import './Navigation.css'

export default function Navigation() {
	function Home() {
		return <h4>Home</h4>;
	}

	function Menu() {
		return <h4>Menu</h4>;
	}

	function User() {
		return <h4>User</h4>;
	}
	return (
			<div>
				<div className='nav'>
					<ul>
						<li><Link to="/">Home</Link></li>
						<li><Link to="/menu">Menu</Link></li>
						<li><Link to="/user">User</Link></li>
					</ul>
				</div>
			</div>
	  );
}
